import React from 'react';
import {Row, Col} from 'reactstrap';

export const Contact = () => {
    return (
        <>
        <div className="contactDiv" style={{marginTop:"3rem"}} >
        <Row xs="2">
        <Col style={{textAlign:"right"}} className="contactTitle">Call at:</Col>
        <Col style={{textAlign:"left"}} className="contactDetails">+91 7276072667</Col>
        <Col style={{textAlign:"right"}} className="contactTitle">Mail at:</Col>
        <Col style={{textAlign:"left"}} className="contactDetails">maithiaharsh@gmail.com</Col>
      </Row>        
        </div>

        <div className="contactDiv">

        </div>


        </>
    )
}
